import styled from 'styled-components'

export const Nav = styled.nav`
    background: #000;
    height: 80px;

    display: flex;
    justify-content:center;
    align-items:center;
    font-size: 1rem;
    position: sticky;
    top: 0;
    z-index: 10;

    @mednia screen and(max-widts:960px){
        transition:0.8 all ease
    }
`

export const NavbarContainer = styled.div`
    display:flex;
    justify-content:space-between;
    height: 80ps;
    z-index:1;
    width 100%;
    padding: 0.24px;
    max-width: 1100px;
`
